export let loading = "loading";
export let getFont = "getFont";
export function getFontsList() {
  let fonts = [];
  return dispatch => {
    dispatch({ type: loading, payload: [] });
    setTimeout(() => {
      dispatch({ type: getFont, payload: fonts });
    });
  };
}
